import { NavLink } from "react-router-dom";
import styles from "./Navigation__styles.module.css";

const Navigation = () => {

  return (
    <div className={styles.header}>
      <div>
        <NavLink
          className={styles.link}
          to="/hot"
        >
          GITÓWA!
        </NavLink>
        <NavLink
          className={styles.link}
          to="/regular"
        >
          takie to jakieś nie wiem...
        </NavLink>
        
      </div>
    </div>
  );
};

export default Navigation;
